--
-- Table structure for table `tickets`
--

DROP TABLE IF EXISTS `tickets`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tickets` (
  `id` int NOT NULL AUTO_INCREMENT,
  `asset_id` int DEFAULT NULL,
  `employee_id` int DEFAULT NULL,
  `corrected_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `issue_description` text COLLATE utf8mb4_unicode_ci,
  `solution` text COLLATE utf8mb4_unicode_ci,
  `issue_attachment_path` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `solution_attachment_path` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `repair_type` enum('Hardware','Software','Driver','Install','Email','Setup','AD_Error','Network','Install_Network','Printer','User_Error','Training','Virus','MC_Frame','AX','Maintenance','Therefore','Location_Change','Replacement','Other') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `handled_by` int DEFAULT NULL,
  `status` enum('Pending','In Progress','Completed','Rejected') COLLATE utf8mb4_unicode_ci DEFAULT 'Pending',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `internal_phone` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_ticket_asset` (`asset_id`),
  KEY `fk_ticket_employee` (`employee_id`),
  KEY `fk_ticket_user` (`handled_by`),
  CONSTRAINT `fk_ticket_asset` FOREIGN KEY (`asset_id`) REFERENCES `assets` (`id`) ON DELETE CASCADE,
  CONSTRAINT `fk_ticket_employee` FOREIGN KEY (`employee_id`) REFERENCES `employees` (`id`) ON DELETE SET NULL,
  CONSTRAINT `fk_ticket_user` FOREIGN KEY (`handled_by`) REFERENCES `users` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=11848 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

